const messages = $('HTTP Request').all();
const messageList = messages[0].json.messageList;
const messegeRows = $('Execute Workflow Trigger').all()[0].json.messegeRow;

// messageList의 값들을 배열로 변환하여 필터링
const filteredMessages = Object.values(messageList).filter(message => 
    message.statusCode !== "4000"
);

// filteredMessages의 to 값을 사용하여 messegeRow 찾기
const matchedRows = filteredMessages.map(message => {
    // messegeRows가 배열이므로 find 메소드 사용 가능
    return messegeRows.find(row => row.phoneKey === message.to);
}).filter(Boolean); // null/undefined 제거

return matchedRows;
